import React, { useState } from 'react'

export const Hilfe = () => {
    const [text,setText] = useState()
    const inhalt = 'Epsilorumequorum'
    let pressed = true
    function openHelp(){
        if(pressed){
            pressed = false
            setText(        
                <p>
                    {inhalt}
                </p>
            )
        }
        else{
            pressed = true
            setText(
                <p>
                    ''
                </p>
            )
        }
        
    }
  return (
    <div>
        <button id='help' onClick={openHelp}>HELP</button>
        <div>
            {text}
        </div>
    </div>
  )
}
